<!DOCTYPE html>
<html xmlns="http://www.w3.org/1999/xhtml">
<head>
    <title></title>
    <script type="text/javascript">

        function getUrlParameter(name) {
            name = name.replace(/[\[]/, '\\[').replace(/[\]]/, '\\]');
            var regex = new RegExp('[\\?&]' + name + '=([^&#]*)');
            var results = regex.exec(location.search);
            return results === null ? '' : decodeURIComponent(results[1].replace(/\+/g, ' '));
        };

        var urlparam = getUrlParameter('eid');

        var urlredirect = "";
        var opciones = "location=no, menubar=no, status=no, titlebar=no, toolbar=no, scrollbars=yes, resizable=yes, width=1200, height=768, left=100, top=50";
        switch (urlparam) {
            case "ags": urlredirect = "https://docs.google.com/forms/d/e/1FAIpQLSeMMMn9JDtyD4aXQdK2KIaN3or7EsDGD0Iq-1bAs9ymgbm4Gg/viewform?usp=sf_link";
                break;
            case "scc": urlredirect = "https://docs.google.com/forms/d/e/1FAIpQLSeFh7IkX4QS9TMIF_cInBXAXsVFowB2XtsFdpjZKsjOoSWcrw/viewform?usp=sf_link";
                break;
            default: urlredirect = "";
        }
        window.open(urlredirect, "_self", opciones);

    </script>
</head>
<body>
</body>
</html>
